import React from 'react';
import {Link} from 'react-router-dom'

export const Categories = props => {
    return (
        <div className="categories">
            <ul>
                <li> <Link to='/head'>Headphones</Link> </li>
                <li>Laptops</li>
                <li>Phones</li>
            </ul>
        </div>
    )
}
